	public static void SaveCloverAuthCode(string authCode)
	{
		GClass6 gClass = new GClass6();
		Terminal terminal = gClass.Terminals.Where((Terminal o) => o.SystemName.ToUpper() == Environment.MachineName.ToUpper()).FirstOrDefault();
